import React from "react"
import { Text,View ,Button} from "react-native"
import Header from "./Header"
export default function Home() {
        return(
            <View>
                    <Header/>
                <Text>Hello </Text>
                <Button title="About" onPress={()=>{
                    this.props.navigation.navigate('About')
                }}/>
            </View>
        )
    }
